import React, { useState } from "react";
import {
  generateRoomSummary,
  generatePsychrometricTable,
  generateFinalSummary,
} from "../api";

const MitigationForm = () => {
  const [jobInfo, setJobInfo] = useState({
    customerName: "",
    jobAddress: "",
    claimNumber: "",
    jobType: "",
    paymentStatus: "",
    waitingInsurance: "",
  });

  const [rooms, setRooms] = useState([
    { name: "", readings: "", image: null, summary: "" },
  ]);

  const [psychroSummary, setPsychroSummary] = useState("");
  const [finalSummary, setFinalSummary] = useState("");

  // Update job info
  const handleInputChange = (e) => {
    setJobInfo({ ...jobInfo, [e.target.name]: e.target.value });
  };

  // Add more rooms
  const addRoom = () => {
    setRooms([...rooms, { name: "", readings: "", image: null, summary: "" }]);
  };

  const handleRoomChange = (index, field, value) => {
    const newRooms = [...rooms];
    newRooms[index][field] = value;
    setRooms(newRooms);
  };

  // ============= AI SUMMARY FOR ROOM =================
  const generateRoomAI = async (index) => {
    try {
      const res = await generateRoomSummary({
        roomName: rooms[index].name,
        moistureReadings: rooms[index].readings,
      });
      handleRoomChange(index, "summary", res.summary);
    } catch (err) {
      alert("AI Error - Check backend.");
      console.error(err);
    }
  };

  // ============ PSYCHROMETRIC TABLE =================
  const generatePsychro = async () => {
    try {
      const res = await generatePsychrometricTable({ rooms });
      setPsychroSummary(res.summary);
    } catch (err) {
      console.error(err);
    }
  };

  // ========== FINAL INSURANCE SUMMARY  ===============
  const generateFinalJob = async () => {
    try {
      const res = await generateFinalSummary({ jobInfo, rooms, psychroSummary });
      setFinalSummary(res.summary);
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div className="form-container">
      <h2>üõ†Ô∏è ToolbeltAI Mitigation Logger</h2>

      {/* JOB INFO */}
      <section className="section-box">
        <h3>üìå Job Information</h3>
        <input name="customerName" placeholder="Customer Name" onChange={handleInputChange} />
        <input name="jobAddress" placeholder="Job Address" onChange={handleInputChange} />
        <input name="claimNumber" placeholder="Claim Number" onChange={handleInputChange} />

        <select name="jobType" onChange={handleInputChange}>
          <option value="">Select Job Type</option>
          <option>Water Damage</option>
          <option>Fire</option>
          <option>Mold</option>
          <option>Storm Damage</option>
        </select>

        <select name="paymentStatus" onChange={handleInputChange}>
          <option value="">Select Payment Status</option>
          <option>Customer Paid</option>
          <option>Waiting On Insurance</option>
          <option>Not Paid</option>
        </select>

        <select name="waitingInsurance" onChange={handleInputChange}>
          <option value="">Waiting on Insurance?</option>
          <option>Yes</option>
          <option>No</option>
        </select>
      </section>

      {/* ROOMS */}
      <section className="section-box">
        <h3>üè† Rooms & Readings</h3>
        {rooms.map((room, index) => (
          <div key={index} className="room-box">
            <input
              placeholder="Room Name (e.g., Basement)"
              onChange={(e) => handleRoomChange(index, "name", e.target.value)}
            />
            <textarea
              placeholder="Moisture Readings"
              onChange={(e) => handleRoomChange(index, "readings", e.target.value)}
            />
            <button onClick={() => generateRoomAI(index)}>‚öôÔ∏è Generate AI Summary</button>
            {room.summary && <p className="ai-output">{room.summary}</p>}
          </div>
        ))}
        <button onClick={addRoom}>‚ûï Add Another Room</button>
      </section>

      {/* PSYCHRO */}
      <section className="section-box">
        <h3>üìä Psychrometric Table</h3>
        <button onClick={generatePsychro}>‚öôÔ∏è Generate Psychrometric Table</button>
        {psychroSummary && <p className="ai-output">{psychroSummary}</p>}
      </section>

      {/* FINAL SUMMARY */}
      <section className="section-box">
        <h3>üìÑ Final Insurance Summary</h3>
        <button onClick={generateFinalJob}>‚öôÔ∏è Generate Final Summary</button>
        {finalSummary && <p className="ai-output">{finalSummary}</p>}
      </section>
    </div>
  );
};

export default MitigationForm;
